import React, { useState } from 'react';
import './App.css';
import Card from './Components/Card';

function App() {
	const [cards, setCards] = useState([]);
	return (
		<div className='app'>
			<div className='cards-container'>
				cards.map(card) => {
					<Card />
				}
			</div>
		</div>		
	)
}

export default App;
